/********************************
		CALCULO TEORICO
********************************/


function calcular(){
    var p50 = document.getElementById("prova50").value;
    p50 = parseFloat(p50);
     var p100 = document.getElementById("prova100").value;
    p100 = parseFloat(p100);
     var ficha = document.getElementById("fichamento").value;
    ficha = parseFloat(ficha);
     var port = document.getElementById("portfolio").value;
    port = parseFloat(port);
     var pu = document.getElementById("punica").value;
    pu = parseFloat(pu);
	
	if (ficha == 0 || port == 0){
		var pu = (pu/2);
	}
	if (ficha == 0 && port == 0){
		var pu = 0;
	}
	if (pu == -2){
		var text = (text - 2);
	}
	if (p50 > p100){
    	var text = eval("((((p50 + p100)/2)*0.8) + ficha + port + pu)"); 
	}
	if (p50 <= p100){
    	var text = eval("((p100 * 0.8) + ficha + port + pu)"); 
	}
	if (text == 0){
		var text = eval(0);
	}
	if (text > 10){
		var text = eval(10);
	}
    document.getElementById("divcalteorico").innerHTML = "<h3>Média Final: </h3>" + text;
	
}


